import { useState } from "react";
import {
  TextField,
  Button,
  Container,
  Typography,
  Box,
  IconButton,
  InputAdornment,
} from "@mui/material";
import { Visibility, VisibilityOff } from "@mui/icons-material";
import { Link, useNavigate } from "react-router-dom";
import API from "../services/api";

const Signup = () => {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    name: "",
    email: "",
    password: "",
  });
  const [showPassword, setShowPassword] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    await API.post("/auth/signup", form);
    navigate("/");
  };

  return (
    <Box
      sx={{
        minHeight: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        background: "linear-gradient(135deg, #4dabf5, #1976d2)", // linear gradient background
      }}
    >
      <Container maxWidth="sm">
        <Box
          sx={{
            background: "rgba(255, 255, 255, 0.1)", // glassmorphism effect
            backdropFilter: "blur(12px)",
            borderRadius: 3,
            boxShadow: "0 8px 32px rgba(0, 0, 0, 0.1)",
            p: 5,
          }}
        >
          <Typography variant="h5" sx={{ mb: 3, color: "#fff", fontWeight: 600 }}>
            Signup
          </Typography>

          <form onSubmit={handleSubmit}>
            <TextField
              fullWidth
              variant="outlined"
              label="Name"
              margin="normal"
              onChange={(e) => setForm({ ...form, name: e.target.value })}
              InputLabelProps={{ style: { color: "#e0f7fa" } }}
              sx={{
                input: { color: "#fff" },
                "& .MuiOutlinedInput-root": {
                  "& fieldset": { borderColor: "rgba(255,255,255,0.3)" },
                  "&:hover fieldset": { borderColor: "#90caf9" },
                  "&.Mui-focused fieldset": { borderColor: "#90caf9" },
                },
              }}
            />

            <TextField
              fullWidth
              variant="outlined"
              label="Email"
              margin="normal"
              onChange={(e) => setForm({ ...form, email: e.target.value })}
              InputLabelProps={{ style: { color: "#e0f7fa" } }}
              sx={{
                input: { color: "#fff" },
                "& .MuiOutlinedInput-root": {
                  "& fieldset": { borderColor: "rgba(255,255,255,0.3)" },
                  "&:hover fieldset": { borderColor: "#90caf9" },
                  "&.Mui-focused fieldset": { borderColor: "#90caf9" },
                },
              }}
            />

            <TextField
              fullWidth
              variant="outlined"
              label="Password"
              type={showPassword ? "text" : "password"}
              margin="normal"
              onChange={(e) => setForm({ ...form, password: e.target.value })}
              InputLabelProps={{ style: { color: "#e0f7fa" } }}
              InputProps={{
                endAdornment: (
                  <InputAdornment position="end">
                    <IconButton
                      onClick={() => setShowPassword(!showPassword)}
                      sx={{ color: "#fff" }}
                    >
                      {showPassword ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                  </InputAdornment>
                ),
              }}
              sx={{
                input: { color: "#fff" },
                "& .MuiOutlinedInput-root": {
                  "& fieldset": { borderColor: "rgba(255,255,255,0.3)" },
                  "&:hover fieldset": { borderColor: "#90caf9" },
                  "&.Mui-focused fieldset": { borderColor: "#90caf9" },
                },
              }}
            />

            <Button
              fullWidth
              variant="contained"
              type="submit"
              sx={{
                mt: 3,
                py: 1.5,
                fontWeight: 600,
                background: "linear-gradient(90deg, #90caf9, #1976d2)",
                color: "#fff",
                transition: "0.3s",
                "&:hover": {
                  background: "linear-gradient(90deg, #1976d2, #4dabf5)",
                  transform: "scale(1.02)",
                },
              }}
            >
              Signup
            </Button>
          </form>

          <Typography mt={2} sx={{ color: "#e0f7fa" }}>
            Already registered? <Link to="/" style={{ color: "#fff", textDecoration: "underline" }}>Login</Link>
          </Typography>
        </Box>
      </Container>
    </Box>
  );
};

export default Signup;
